import { Box, Checkbox, FormControl, FormControlLabel, FormGroup, InputLabel, MenuItem, Paper, Select } from "@mui/material";

const FeedFilter2 = () => {

    return (
        <Paper
            component="form"
            sx={{ p: '2px 4px', display: {xs: 'block', md: 'flex'}, alignItems: 'center', mb: 5}}
        >
            <Box sx={{ display: 'flex', alignItems: 'center' }}>
                <FormControl component="fieldset" sx={{ ml: 1 }}>
                    <FormGroup aria-label="position" row>
                        <FormControlLabel 
                            value="end"
                            control={<Checkbox defaultChecked={true} />}
                            label="Team"
                            labelPlacement="end"
                        />
                        <FormControlLabel 
                            value="end"
                            control={<Checkbox defaultChecked={true} />}
                            label="Trainer"
                            labelPlacement="end"
                        />
                        <FormControlLabel 
                            value="end"
                            control={<Checkbox defaultChecked={true} />}
                            label="Free Agent"
                            labelPlacement="end"
                        />
                    </FormGroup>
                </FormControl>
                <FormControl sx={{ ml: 1, minWidth: 100 }} size="small">
                    <InputLabel id="simple-select-label">State</InputLabel>
                    <Select
                        labelId="simple-select-label"
                        id="simple-select"
                        value={state}
                        label="State"
                        onChange={handleChange}
                        MenuProps={MenuProps}
                    >
                        {states.map((name) => (
                            <MenuItem
                                key={name}
                                value={name}
                            >
                                {name}
                            </MenuItem>
                        ))}
                    </Select>
                </FormControl>
            </Box>
        </Paper>
    )
}

export default FeedFilter2;
